  false,\n\t\"url\": null,\n\t\"notes\": \"These data are part of an ocean observation
  study by Stabeno, Napp, and Whitledge sponsored, in part, by the North Pacific Research
  Board (Project 602; http://doc.nprb.org).  The grant was titled \"Sentinels for
  Bering Sea ecosystem change.\"  Moorings have been maintained on the southeastern
  Bering Sea shelf at four sites: M2 (56.9B0N, 164.1B0W) since 1995, M4 (57.9B0N,
  168.9B0W) since 1996; M5 (59.9B0N, 171.7B0W) and; M8 (62.2B0N 174.7B0W) since 2004.
  Shipboard measurements of temperature, salinity, nutrients, chlorophyll, fluorescence
  and zooplankton were collected around the moorings and along the 70-m isobath on
  2 cruises (2MF06, 12 April b?? 6 May; 7MF06, 25 September b?? 10 October) to groundtruth
  the in situ sensors on the moorings and to learn the factors that distinguish the
  upper water column of the central and southeastern middle shelf.\",\n\t\"owner_org\":
